import { REHYDRATE } from 'redux-persist';

const initialState = {
  User: null,
  LoggedIn: false,
  Error: null
};

export const StorageReducer = (state = initialState, action) => {
  switch (action.type) {
      
    case REHYDRATE:
      return {
        ...state, 
        User: action.payload.User,
        LoggedIn:action.payload.LoggedIn,
        Error: action.payload.Error
      };
      default:
        return state;
    }      
}
